import React, { useState } from 'react';
import Home from "./Home";
import About from "./About";
import "./Main.css";

function Main() {
    const [currentPage, setCurrentPage] = useState("");

    const renderPage = () => {
        switch(currentPage){
            case "home":
                return <Home />;
            case "about":
                return <About />;
            default:
                return<>
                    <div>
                        <h1>TOP 3</h1>

                    </div>
                </>
        }
    };

    return (
        <>
            {renderPage()}
        </>
    );
}

export default Main;
